class Game:
    def __init__(self, screen: pygame.Surface, board: chess.Board, images: dict[str, str], font: pygame.font.Font) -> None:
        self.board = board
        self.players = {"white": Player(chess.WHITE), "black": Player(chess.BLACK)}
        self.moves = dict()
        self.last_move = None
        self.game_end = False
        self.move_num = 1
        self.images = images
        self.font = font
        self.screen = screen
    def loop(self, events: tuple[pygame.event.Event, ...]) -> None:
        if not self.game_end:
            if self.board.turn == chess.WHITE:
                self.players["white"].on_move(self.board, events)
                self.game_state = "On turn: White"
            else:
                self.players["black"].on_move(self.board, events)
                self.game_state = "On turn: Black"
            
            draw_board(self.board, self.screen, (self.players["white"], self.players["black"]), self.images)

            if self.board.outcome() != None:
                #print("Game ended: ", self.board.outcome())
                self.game_state = f"Game ended: {self.board.outcome().result}"
                self.game_end = True

        self.screen.blit(self.font.render(self.game_state, True, FONT_COLOR), (610,0))
        try:
            if self.board.peek() != self.last_move:
                self.last_move = self.board.peek()
                self.moves[self.move_num] = self.last_move
                self.move_num += 1
            print_game_log(self.screen, self.font, self.moves)
        except IndexError:
            self.screen.blit(self.font.render("No moves", True, FONT_COLOR), (610,FONT_SIZE+5))

    def exit_game():
        pygame.quit()


class Player:
    def __init__(self, color: bool) -> None:
        self.is_playing      = False
        self.color           = color
        self.selected_piece  = None
        self.selected_square = None
        self.king            = chess.Piece(chess.KING,   color)
        self.queen           = chess.Piece(chess.QUEEN,  color)
        self.rook_1          = chess.Piece(chess.ROOK,   color)
        self.rook_2          = chess.Piece(chess.ROOK,   color)
        self.knight_1        = chess.Piece(chess.KNIGHT, color)
        self.knight_2        = chess.Piece(chess.KNIGHT, color)
        self.bishop_1        = chess.Piece(chess.BISHOP, color)
        self.bishop_2        = chess.Piece(chess.BISHOP, color)
        self.pawn_1          = chess.Piece(chess.PAWN,   color)
        self.pawn_2          = chess.Piece(chess.PAWN,   color)
        self.pawn_3          = chess.Piece(chess.PAWN,   color)
        self.pawn_4          = chess.Piece(chess.PAWN,   color)
        self.pawn_5          = chess.Piece(chess.PAWN,   color)
        self.pawn_6          = chess.Piece(chess.PAWN,   color)
        self.pawn_7          = chess.Piece(chess.PAWN,   color)
        self.pawn_8          = chess.Piece(chess.PAWN,   color)
        self.pieces          = [self.king, self.queen, self.rook_1, self.rook_2, self.knight_1, self.knight_2, self.bishop_1, self.bishop_2, self.pawn_1, self.pawn_2, self.pawn_3, self.pawn_4, self.pawn_5, self.pawn_6, self.pawn_7, self.pawn_8]

    def on_move(self, board: chess.Board, events: tuple[pygame.event.Event, ...]) -> None:
        for event in events:
            if event.type == pygame.MOUSEBUTTONDOWN:
                mouse_pos = pygame.mouse.get_pos()
                x = int(mouse_pos[0] // SQUARE_SIZE)
                y = 7 - int(mouse_pos[1] // SQUARE_SIZE)
                square = chess.square(x, y)
                piece = board.piece_at(square)

                if self.selected_piece:
                    if square == self.selected_square:
                        #print("Cancelling move")
                        self.selected_piece = None
                        self.selected_square = None
                    elif board.color_at(square) == self.color:
                        #print("Reselecting piece")
                        self.selected_piece = piece
                        self.selected_square = square
                    else:
                        move = chess.Move(self.selected_square, square)
                        if move in board.legal_moves:
                            board.push(move)
                            self.selected_piece = None
                            self.selected_square = None
                elif piece:
                    if piece.color == self.color:
                        self.selected_piece = piece
                        self.selected_square = square


class AI:
    def __init__(self, color: bool, difficulty: str) -> None:
        self.difficulty = difficulty
        self.color = color
        self.selected_piece = None  # Přidání atributu selected_piece

    def on_move(self, board: chess.Board, events: tuple[pygame.event.Event, ...]) -> chess.Move:
        if self.difficulty == "easy":
            move = self.easy_move(board)
        elif self.difficulty == "medium":
            move = self.medium_move(board)
        elif self.difficulty == "hard":
            move = self.hard_move(board)
        elif self.difficulty == "Fales":
            move = self.fales_move(board)
        else:
            raise ValueError("Difficulty not selected")

        if move:
            board.push(move)
            self.selected_piece = None  # Reset selected_piece po tahu
        return move

    def easy_move(self, board: chess.Board) -> chess.Move:
        """AI s náhodnými tahy."""
        return random.choice(list(board.legal_moves))

    def medium_move(self, board: chess.Board) -> chess.Move:
        """AI prioritizující zachycení a kontrolu centrálních polí."""
        legal_moves = list(board.legal_moves)
        capture_moves = [move for move in legal_moves if board.is_capture(move)]
        center_squares = [chess.D4, chess.E4, chess.D5, chess.E5]

        # Prioritizace zachycení figury
        if capture_moves:
            return random.choice(capture_moves)

        # Prioritizace kontroly centrálních polí
        central_moves = [move for move in legal_moves if move.to_square in center_squares]
        if central_moves:
            return random.choice(central_moves)

        # Pokud není zachycení ani kontrola centra, zvolí náhodný tah
        return random.choice(legal_moves)

    def hard_move(self, board: chess.Board) -> chess.Move:
        """AI hledá nejlepší tah s důrazem na agresivitu."""
        best_move = None
        best_value = -9999

        for move in board.legal_moves:
            board.push(move)
            board_value = self.evaluate_board(board)
            board.pop()

            # Zvýšená hodnota pro agresivní tahy (zachycení a kontrola centra)
            if board.is_capture(move):
                board_value += 5
            elif move.to_square in [chess.D4, chess.E4, chess.D5, chess.E5]:
                board_value += 3

            if board_value > best_value:
                best_value = board_value
                best_move = move

        return best_move

    def fales_move(self, board: chess.Board) -> chess.Move:
        """AI s hlubokou analýzou tahů."""
        best_move, _ = self.minimax(board, depth=3, maximizing_player=True)
        return best_move

    def minimax(self, board: chess.Board, depth: int, maximizing_player: bool = True):
        if depth == 0 or board.is_game_over():
            return None, self.evaluate_board(board)

        best_move = None
        if maximizing_player:
            best_value = -9999
            for move in board.legal_moves:
                board.push(move)
                _, value = self.minimax(board, depth - 1, False)
                board.pop()

                if value > best_value:
                    best_value = value
                    best_move = move
            return best_move, best_value
        else:
            best_value = 9999
            for move in board.legal_moves:
                board.push(move)
                _, value = self.minimax(board, depth - 1, True)
                board.pop()

                if value < best_value:
                    best_value = value
                    best_move = move
            return best_move, best_value
        
    def evaluate_board(self, board: chess.Board) -> int:
        """Hodnotí pozici na šachovnici."""
        if board.is_checkmate():
            return 10000 if board.turn == chess.BLACK else -10000
        if board.is_stalemate() or board.is_insufficient_material():
            return 0

        piece_values = {
            chess.PAWN: 1,
            chess.KNIGHT: 3,
            chess.BISHOP: 3,
            chess.ROOK: 5,
            chess.QUEEN: 9,
            chess.KING: 0
        }

        value = 0
        for piece in board.piece_map().values():
            piece_value = piece_values[piece.piece_type]
            value += piece_value if piece.color == self.color else -piece_value

        # Přidání strategického hodnocení
        value += self.position_score(board)

        return value


    def position_score(self, board: chess.Board) -> int:
        """Vyhodnocení pozice na základě umístění figur."""
        score = 0
        piece_square_values = {
            chess.PAWN: [0, 0, 0, 0, 0, 0, 0, 0],
            chess.KNIGHT: [-5, -4, -3, -3, -3, -3, -4, -5],
            chess.BISHOP: [-4, -2, -1, -1, -1, -1, -2, -4],
            chess.ROOK: [-2, -1, 0, 0, 0, 0, -1, -2],
            chess.QUEEN: [-1, 0, 0, 0, 0, 0, 0, -1],
            chess.KING: [0, 1, 1, 3, 3, 1, 1, 0],
        }

        for square, piece in board.piece_map().items():
            piece_value = piece_square_values[piece.piece_type]
            if piece.color == self.color:
                score += piece_value[square // 8]
            else:
                score -= piece_value[square // 8]

        return score

def font_renderer(screen: pygame.Surface, text: str, pos: tuple[int, int], pos_type: str) -> None:
    surface = FONT.render(text, True, FONT_COLOR)
    if pos_type == "topleft":
        rect = surface.get_rect(topleft=pos)
    elif pos_type == "topright":
        rect = surface.get_rect(topright=pos)
    elif pos_type == "center":
        rect = surface.get_rect(center=pos)
    elif pos_type == "bottomright":
        rect = surface.get_rect(bottomright=pos)
    elif pos_type == "bottomleft":
        rect = surface.get_rect(bottomleft=pos)
    elif pos_type == "midtop":
        rect = surface.get_rect(midtop=pos)
    elif pos_type == "midleft":
        rect = surface.get_rect(midleft=pos)
    elif pos_type == "midbottom":
        rect = surface.get_rect(midbottom=pos)
    elif pos_type == "midright":
        rect = surface.get_rect(midright=pos)
    else:
        raise ValueError("Invalid position type")
    screen.blit(surface, rect)

def get_color(color: bool) -> str:
    return "white" if color==True else "black"
    
def init_game(debug=False) -> tuple[pygame.Surface, chess.Board, log.Logger, pygame.time.Clock, Dict[str, pygame.Surface], pygame.font.Font]:
    os.chdir(os.path.dirname(os.path.abspath(__file__)))
    logger = log.getLogger(__name__)
    if debug:
        log.basicConfig(level=log.DEBUG, format='%(asctime)s - [%(name)s] - %(levelname)s - %(message)s')
    else:
        log.basicConfig(level=log.INFO,  format='%(asctime)s - [%(name)s] - %(levelname)s - %(message)s')
    logger.debug("Initializing app")

    pygame.init()
    screen = pygame.display.set_mode((WIDTH, HEIGHT))
    board = chess.Board()
    clock = pygame.time.Clock()

    font = pygame.font.SysFont('consolas', FONT_SIZE)
    images = load_images(debug)
    return screen, board, logger, clock, images, font

def load_images(debug=False) -> Dict[str, pygame.Surface]:
    if debug:
        images = {}
        pieces = ["king", "queen", "rook", "bishop", "knight", "pawn"]
        colors = ["white", "black"]
        for piece in pieces:
            for color in colors:
                img = pygame.image.load(f"assets/{piece}/{color}.png")
                img = pygame.transform.scale(img, (SQUARE_SIZE, SQUARE_SIZE))
                images[f"{color}_{piece}"] = img
        
        img = pygame.image.load("assets/WhiteSquare.png")
        img = pygame.transform.scale(img, (SQUARE_SIZE, SQUARE_SIZE))
        images["white_square"] = img
        img = pygame.image.load("assets/BlackSquare.png")
        img = pygame.transform.scale(img, (SQUARE_SIZE, SQUARE_SIZE))
        images["black_square"] = img        

        return images
    else:
        images = {}

        pieces = ["king", "queen", "rook", "bishop", "knight", "pawn", "square"]
        colors = ["white", "black"]
        for piece in pieces:
            for color in colors:
                try:
                    img_b64 = IMAGES[f"{color}_{piece}"]
                except:
                    img_b64 = ""
                    print(f"! Could not load {piece} image")
                img_data = base64.b64decode(img_b64)
                img_bytes = io.BytesIO(img_data)
                img = pygame.image.load(img_bytes)
                img = pygame.transform.scale(img, (SQUARE_SIZE, SQUARE_SIZE))
                images[f"{color}_{piece}"] = img
                
        return images

def draw_piece(piece: chess.Piece, screen: pygame.Surface, pos: tuple[int, int], piece_images: Dict[str, pygame.Surface]) -> None:
    color = get_color(piece.color)
    type = chess.piece_name(piece.piece_type)
    x, y = pos
    x = x*SQUARE_SIZE
    y = y*SQUARE_SIZE
    img = piece_images[f"{color}_{type}"]

    screen.blit(img, (pos[0]*SQUARE_SIZE, pos[1]*SQUARE_SIZE))

def draw_square_overlay(screen: pygame.Surface, row: int, col: int, images: Dict[str, pygame.Surface]) -> None:
    if (row + col) % 2 == 1:
        screen.blit(images["black_square"], (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE))
    else:
        screen.blit(images["white_square"], (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE))
    pygame.draw.rect(screen, (128, 255, 128), (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE), width=15)

def draw_board(board: chess.Board, screen: pygame.Surface, players: tuple[Player, Player], images: Dict[str, pygame.Surface]) -> None:
    legal_moves = None
    screen.fill(EGGSHELL)
    for row in range(ROWS):
        for col in range(COLS):
            if (row + col) % 2 == 1:
                screen.blit(images["black_square"], (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE))
            else:
                screen.blit(images["white_square"], (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE))
    
    if board.turn == chess.WHITE:
        if players[0].selected_piece:
            row = 7 - chess.square_rank(players[0].selected_square)
            col = chess.square_file(players[0].selected_square)
            pygame.draw.rect(screen, (0, 255, 0), (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE))
            legal_moves = [move for move in board.legal_moves if move.from_square == players[0].selected_square]
    else:
        if players[1].selected_piece:
            row = 7 - chess.square_rank(players[1].selected_square)
            col = chess.square_file(players[1].selected_square)
            pygame.draw.rect(screen, (0, 255, 0), (col * SQUARE_SIZE, row * SQUARE_SIZE, SQUARE_SIZE, SQUARE_SIZE))
            legal_moves = [move for move in board.legal_moves if move.from_square == players[1].selected_square]

    if legal_moves:    
        for move in legal_moves:
            row = 7 - chess.square_rank(move.to_square)
            col = chess.square_file(move.to_square)
            draw_square_overlay(screen, row, col, images)

    x = 0
    y = 0
    for char in list(board.board_fen()):
        if char == "/":
            x = 0
            y += 1
        elif char.isnumeric():
            x += int(char)
        else:
            piece = chess.Piece.from_symbol(char)
            draw_piece(piece, screen, (x, y), images)
            x += 1

def print_game_log(screen: pygame.Surface, font: pygame.font.Font, moves: Dict[int, chess.Move]) -> None:
    if moves:
        if len(moves) > 15:
            moves = dict(list(moves.items())[-15:])
        x = FONT_SIZE + 5
        n = 1
        for index, move in moves.items():
            text = f"{index}. {move.uci()}"
            screen.blit(font.render(text, True, FONT_COLOR), (610,x))
            x += FONT_SIZE + 5
            n += 1

